import React, { useEffect, useState } from "react";
import ItemCard from "./ItemCard";
import "./BestProducts.css";
import { getProducts } from "../../../services/itemApi";

function BestItemSection() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    getProducts()
      .then((data) => setProducts(data.list))
      .catch((error) => console.error("Product fetching error:", error));
  }, []);

  return (
    <div className="bestItemsContainer">
      <h1 className="bestTitle">베스트 상품</h1>
      {products.map((item) => (
        <ItemCard key={item.id} item={item} />
      ))}
    </div>
  );
}

export default BestItemSection;
